INSERT INTO `courses` VALUES ('c1299562-628b-4752-a968-787228ca7434','AI agent','<p>An AI agent is <strong><mark style=\"background-color: rgb(52, 69, 127)\">a software system that uses artificial intelligence to perform tasks, pursue goals, and make decisions autonomously on behalf of a user or another system</mark></strong>. These agents can process various forms of data, reason, learn, and adapt to their environment to achieve desired outcomes.&nbsp;</p><p>Here\'s a more detailed explanation:</p><p><strong>Key Characteristics of AI Agents:</strong></p><ul class=\"list-disc ml-3\"><li><p><strong>Autonomy:</strong></p><p>AI agents can operate with minimal or no direct human intervention, making decisions and taking actions based on their programming and learned information.&nbsp;</p></li><li><p><strong>Goal-Oriented:</strong></p><p>They are designed to achieve specific objectives, whether it\'s completing a task, solving a problem, or providing information.&nbsp;</p></li><li><p><strong>Adaptability:</strong></p><p>AI agents can learn from data, user feedback, and their environment to improve their performance and decision-making over time.&nbsp;</p></li><li><p><strong>Reasoning and Planning:</strong></p><p>They can analyze situations, formulate plans, and execute tasks in a logical and efficient manner.&nbsp;</p></li><li><p><strong>Multi-modal Input:</strong></p><p>Modern AI agents can process and understand various types of data, including text, voice, images, and more.&nbsp;</p></li></ul><p><strong>How AI Agents Work:</strong></p><p><strong>AI agents typically involve the following components:&nbsp;</strong></p><ol class=\"list-decimal ml-3\"><li><p><strong>1. Perception:</strong></p><p>The agent senses its environment through sensors (e.g., cameras, microphones, sensors).&nbsp;</p></li><li><p><strong>2. Reasoning:</strong></p><p>The agent analyzes the sensed information, applies rules, and uses knowledge to make decisions.&nbsp;</p></li><li><p><strong>3. Action:</strong></p><p>The agent takes actions based on its reasoning, such as interacting with users, controlling devices, or manipulating objects.&nbsp;</p></li><li><p><strong>4. Learning:</strong></p><p>The agent updates its knowledge and improves its performance based on past experiences and feedback.&nbsp;</p></li></ol><p><strong>Examples of AI Agents:</strong></p><ul class=\"list-disc ml-3\"><li><p><strong>Chatbots and Virtual Assistants:</strong></p><p>AI agents can power conversational interfaces that help users with tasks like scheduling appointments, answering questions, or making travel arrangements.&nbsp;</p></li><li><p><strong>Robotic Process Automation (RPA):</strong></p><p>AI agents can automate repetitive business processes, such as data entry, invoice processing, or report generation.&nbsp;</p></li><li><p><strong>Personalized Recommendation Systems:</strong></p><p>AI agents can analyze user preferences and browsing history to provide tailored recommendations for products, content, or services.&nbsp;</p></li><li><p><strong>Autonomous Vehicles:</strong></p><p>AI agents control the navigation and operation of self-driving cars, using sensors and algorithms to make real-time decisions.&nbsp;</p></li><li><p><strong>Intelligent Manufacturing Systems:</strong></p><p>AI agents can optimize production processes, monitor equipment for maintenance, and improve overall efficiency.&nbsp;</p></li></ul><p><strong>AI Agents vs. Traditional Software:&nbsp;</strong></p><ul class=\"list-disc ml-3\"><li><p>AI agents differ from traditional software in their ability to adapt, learn, and make decisions autonomously.&nbsp;</p></li><li><p>They are not simply tools that execute pre-defined instructions; they can analyze situations, formulate plans, and take actions to achieve goals.&nbsp;</p></li><li><p>AI agents are becoming increasingly integrated with other technologies like the Internet of Things (IoT) and large language models (LLMs), creating more intelligent and interconnected systems.&nbsp;</p></li></ul>','','2025-08-17 02:00:00','2025-08-30 02:00:00','2025-08-04 02:00:00','2025-08-09 02:00:00','2025-08-31 02:00:00',1,3,'$2b$10$vBSYxL5G2c7y8nvH96HY/eeMa1/jLRNU6EYzel4qFObWtjb.pDFyS','b2c3d4e5-f6g7-8901-2345-678901bcdefg','foundation','2025-06-29 02:12:05','2025-08-04 04:02:03',NULL),('course01-1111-2222-3333-444444444444','Lập trình Web với React.js','Khóa học về phát triển ứng dụng web hiện đại với React.js, Redux và các công nghệ frontend tiên tiến','/public/images/course1.jpg','2024-02-01 00:00:00','2024-06-30 00:00:00','2024-01-15 00:00:00','2024-01-31 00:00:00','2024-03-15 00:00:00',1,4,NULL,'b2c3d4e5-f6g7-8901-2345-678901bcdefg','major','2025-06-27 20:20:30','2025-06-27 20:20:30',NULL),('course02-2222-3333-4444-555555555555','Cơ sở dữ liệu nâng cao','Khóa học về thiết kế, tối ưu hóa và quản trị cơ sở dữ liệu MySQL, PostgreSQL','/public/images/course2.jpg','2024-02-15 00:00:00','2024-07-15 00:00:00','2024-01-20 00:00:00','2024-02-10 00:00:00','2024-04-01 00:00:00',1,3,'db2024','e5f6g7h8-i9j0-1234-5678-901234efghij','foundation','2025-06-27 20:20:30','2025-06-27 20:20:30',NULL),('course03-3333-4444-5555-666666666666','Trí tuệ nhân tạo cơ bản','Giới thiệu về Machine Learning, Deep Learning và các ứng dụng AI trong thực tế','/public/images/course3.jpg','2024-03-01 00:00:00','2024-08-01 00:00:00','2024-02-10 00:00:00','2024-02-25 00:00:00','2024-04-15 00:00:00',1,5,NULL,'b2c3d4e5-f6g7-8901-2345-678901bcdefg','elective','2025-06-27 20:20:30','2025-06-27 20:20:30',NULL);
