INSERT INTO `posts` VALUES ('post001-1111-2222-3333-444444444444','Hướng dẫn setup React.js cho người mới bắt đầu','<h2>Giới thiệu về React.js</h2><p>React.js là một thư viện JavaScript mạnh mẽ để xây dựng giao diện người dùng...</p><h3>Cài đặt môi trường</h3><p>Đầu tiên, bạn cần cài đặt Node.js và npm...</p>',1,'b2c3d4e5-f6g7-8901-2345-678901bcdefg','/public/images/react-tutorial.jpg','2025-06-27 20:20:31','2025-06-27 20:20:31',NULL),('post002-2222-3333-4444-555555555555','Best practices khi thiết kế database','<h2>Nguyên tắc thiết kế CSDL</h2><p>Việc thiết kế cơ sở dữ liệu tốt là nền tảng quan trọng...</p><h3>Normalization</h3><p>Chuẩn hóa dữ liệu giúp giảm redundancy...</p>',1,'e5f6g7h8-i9j0-1234-5678-901234efghij','/public/images/database-design.jpg','2025-06-27 20:20:31','2025-06-27 20:20:31',NULL),('post003-3333-4444-5555-666666666666','Chia sẻ kinh nghiệm làm đồ án tốt nghiệp','<h2>Lựa chọn chủ đề</h2><p>Việc chọn đúng chủ đề đồ án rất quan trọng...</p><h3>Quy trình thực hiện</h3><p>Chia nhỏ công việc thành các milestone...</p>',1,'2529834f-d1fc-4a6c-a921-5450f9bba880','1753623837456_1_7xkv_y7riq3u-gbbtmtbrg.png','2025-06-27 20:20:31','2025-07-27 22:43:57',NULL);
